import { MonthArray } from "../../Classes/calendarClass"


const MonthView = () => {
    return (
        <div>
            {MonthArray.map((month, index
            ) => {
                return (
                    <div key={index}>{month}</div>
                )
            })}
        </div>
    )
}

export default MonthView
